<html>

<head>
	<title>Momaxos fantazticos</title>
    <meta name="viewport" content="width=device-width; initial-scale=1.0">
</head>

<body>
	<h2>Momasos</h2>
	
	<p>
		Template:
		<form>
			<input onchange='doit();' type='radio' name='template' value='bob' id='bob_radio' checked='checked'>bOb EsPoNjA</input><br>
			<input onchange='doit();' type='radio' name='template' value='fry' id='fry_radio'>Fry</input><br>
			<input onchange='doit();' type='radio' name='template' value='pik' id='pik_radio'>Pikachu</input><br>
			<input onchange='doit();' type='radio' name='template' value='hem' id='hem_radio'>He man</input><br>
			<input onchange='doit();' type='radio' name='template' value='lui' id='lui_radio'>Luigi</input>
		</form>
	</p>
	
    <p>Texto superior</p>
    <textarea rows="4" cols="50" id='in1' oninput='doit();'></textarea>
	
    <p>Texto inferior</p>
    <textarea rows="4" cols="50" id='in2' oninput='doit();'></textarea>
	
	<p></p>
	&nbsp;<button onclick="clearArea();">Borrar</button>
	<p>
		<canvas id="meme-canvas" title="Right click -> &quot;Save image as...&quot;"></canvas>
	</p>
</body>

<script>
	function populateCheckboxes() {
	
	}
	
	function retard(text){
		var resultado = '';
		var toggle = false;
		for(var i=0; i<text.length; i++){
			if(toggle){
				resultado += text.toLowerCase().charAt(i).toUpperCase();
			} else {
				resultado += text.toLowerCase().charAt(i);
			}
			toggle = !toggle;
		}
		return resultado;
	}
	
	function doit() {
		var t1 = document.getElementById('in1').value;
		var t2 = document.getElementById('in2').value;
		var img;
		if(document.getElementById('bob_radio').checked==true){
			t1 = retard(t1);
			t2 = retard(t2);
			img = img_bob;
		} else if(document.getElementById('fry_radio').checked==true){
			img = img_fry;
		} else if(document.getElementById('pik_radio').checked==true){
			img = img_pik;
		} else if(document.getElementById('hem_radio').checked==true){
			img = img_hem;
		} else if(document.getElementById('lui_radio').checked==true){
			img = img_lui;
		}
		generateMeme(img, t1, t2, 0.1, 0.1);
	}
	
	var ctx, canvas, img_bob, img_fry, img_pik, img_hem, img_lui;
	
	function generateMeme (img, topText, bottomText, topTextSize, bottomTextSize) {
		let fontSize;

		// Size canvas to image
		canvas.width = img.width;
		canvas.height = img.height;

		// Clear canvas
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		// Draw main image
		ctx.drawImage(img, 0, 0);

		// Text style: white with black borders
		ctx.fillStyle = 'white';
		ctx.strokeStyle = 'black';
		ctx.textAlign = 'center';

		// Top text font size
		fontSize = canvas.width * topTextSize;
		ctx.font = fontSize + 'px Impact';
		ctx.lineWidth = fontSize / 20;

		// Draw top text
		ctx.textBaseline = 'top';
		topText.split('\n').forEach(function (t, i) {
			ctx.fillText(t, canvas.width / 2, i * fontSize, canvas.width);
			ctx.strokeText(t, canvas.width / 2, i * fontSize, canvas.width);
		});

		// Bottom text font size
		fontSize = canvas.width * bottomTextSize;
		ctx.font = fontSize + 'px Impact';
		ctx.lineWidth = fontSize / 20;

		// Draw bottom text
		ctx.textBaseline = 'bottom';
		bottomText.split('\n').reverse().forEach(function (t, i) { // .reverse() because it's drawing the bottom text from the bottom up
			ctx.fillText(t, canvas.width / 2, canvas.height - i * fontSize, canvas.width);
			ctx.strokeText(t, canvas.width / 2, canvas.height - i * fontSize, canvas.width);
		});
	}
